.c-card{
  background-color:$ghost;
  
  margin: 2rem;
  border-radius: 4px;
  width: 30%;
  box-shadow: 0 1px 2px rgba(0,0,0,.1);
  // entire container, keeps perspective
    perspective: 1000;

  &__icon{
    font-size: 4rem;
    color: #3681B2;
    background-color: white;
    border-radius: 80px;
    padding: 1.5rem;
  }
  &__title{
    font-weight: 300;
  }
  &__front &__body{
    padding:  2rem;
    transform: translate3d(0,60px,0);
    transition: transform 0.35s cubic-bezier(.67,.33,.53,.8) .1s, opacity 0.5s cubic-bezier(.67,.33,.53,.8) .2s ;
  }
  &__back &__header{
    padding: 1.8rem;
    text-align: center;
    background-color: rgba(221,221,237,0.27);

  }
  &__back &__footer{
    padding:  1rem 2rem;
    text-align: center;
    color: $monsoon;
    // background-color: rgba(221,221,237,0.27);

  }
  &__label{
    font-size: 12px;
    text-transform: uppercase;
    color: $aluminum;
    text-align: right;
    padding-right: 1rem;
  }
 
  &__close{
    position: absolute;
    top:10px;
    right: 10px;
    font-size: .8rem;
    color: $iron;
    text-decoration: none;
    &:hover{
      color: $monsoon;
    }
  }
  input[type="number"]{
    width: 50px;
    text-align: center;
    padding: .5rem;
    font-size: 1.2rem;
  }
  &__see-more{
    background: orange;
    color: $white;
    padding: 1rem 2rem;
    margin:1rem auto; 
    display: block;
    width: 200px;
    transform: translate3d(0,200px,0);
    transition: transform 0.35s cubic-bezier(.67,.33,.53,.8) .1s, opacity 0.5s cubic-bezier(.67,.33,.53,.8) .2s ;
    opacity: 0;
    
  }
  
  &__slideUp{
    //display: none;
    // opacity: 0;
    transition: transform 0.35s cubic-bezier(.67,.33,.53,.8), opacity 0.5s cubic-bezier(.67,.33,.53,.8);
    transform: translate3d(0,200px,0);
    opacity: 0;

  }

  &:hover &__slideUp, &:hover &__see-more, &:hover &__front &__body{ 
    // display:block;
    // opacity: 1;
    transform: translate3d(0,0,0);
    opacity: 1;
    
  }
    // flip the pane when hovered  &:hover &__flipper
  &.hover &__flipper{
      transform: rotateY(180deg);
  }
    // flip speed goes here

    &__flipper{
        transition: 0.6s;
        transform-style: preserve-3d;
        position: relative;
    }
    // hide back of pane during swap
    &__front, &__back {
        backface-visibility: hidden;
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
    }

    &, &__front, &__back {
        height: 350px;
        overflow: hidden;
    }
    // front pane, placed above back
    &__front{
        z-index: 2;
        /* for firefox 31 */
        transform: rotateY(0deg);
        text-align: center;
        background-repeat: no-repeat;
        background-size: cover;
      
    }
    // back, initially hidden pane
    &__back {
        transform: rotateY(180deg);
    }
}

